DROP TABLE IF EXISTS `planner_OMPL_right_arm[RRTConnectkConfigDefault]`;
DROP TABLE IF EXISTS `planner_OMPL_right_arm[SBLkConfigDefault]`;
DROP TABLE IF EXISTS `planner_OMPL_right_arm[LBKPIECEkConfigDefault]`;
DROP TABLE IF EXISTS `planner_OMPL_right_arm[RRTkConfigDefault]`;
DROP TABLE IF EXISTS `planner_OMPL_right_arm[ESTkConfigDefault]`;
DROP TABLE IF EXISTS `planner_OMPL_right_arm[KPIECEkConfigDefault]`;
DROP TABLE IF EXISTS `planner_OMPL_right_arm[BKPIECEkConfigDefault]`;
DROP TABLE IF EXISTS `planner_OMPL_right_arm[RRTStarkConfigDefault]`;
DROP TABLE IF EXISTS `experiments`;
DROP TABLE IF EXISTS `known_planner_configs`;
CREATE TABLE IF NOT EXISTS experiments (id INTEGER PRIMARY KEY AUTO_INCREMENT, name VARCHAR(512), totaltime REAL, timelimit REAL, hostname VARCHAR(1024), date DATETIME, setup TEXT) ENGINE = InnoDB;
CREATE TABLE IF NOT EXISTS known_planner_configs (id INTEGER PRIMARY KEY AUTO_INCREMENT, planner_name VARCHAR(512) NOT NULL, settings TEXT) ENGINE = InnoDB;
CREATE TABLE IF NOT EXISTS `planner_OMPL_right_arm[BKPIECEkConfigDefault]` (experimentid INTEGER, plannerid INTEGER, path_plan_length REAL, path_simplify_clearance REAL, path_simplify_smoothness REAL, path_simplify_time REAL, solved BOOLEAN, process_time REAL, path_simplify_length REAL, path_interpolate_time REAL, path_plan_smoothness REAL, path_interpolate_clearance REAL, path_plan_time REAL, path_simplify_correct BOOLEAN, path_interpolate_smoothness REAL, total_time REAL, path_interpolate_correct BOOLEAN, path_interpolate_length REAL, path_plan_clearance REAL, path_plan_correct BOOLEAN, FOREIGN KEY(experimentid) REFERENCES experiments(id) ON DELETE CASCADE ON UPDATE CASCADE, FOREIGN KEY(plannerid) REFERENCES known_planner_configs(id) ON DELETE CASCADE ON UPDATE CASCADE) ENGINE = InnoDB;
